using System;
using System.Net;
using System.Threading.Tasks;
using Rscue.Api.Models;
using Rscue.Api.Tests.Helpers;
using Rscue.Api.ViewModels;
using Xunit;

namespace Rscue.Api.Tests
{
    public class ClientFixture
    {
        private readonly Random rnd;

        public ClientFixture()
        {
            rnd = new Random();
        }

        //[Fact]
        public async Task CanSaveClient()
        {
            var client = new Client
            {
                BoatModel = "ho7",
                Email = "i@h.com",
                EngineType = "hoho hoho",
                HullSize = HullSizeType.Large,
                LastName = "glinsek",
                Name = "nacho",
                PhoneNumber = "123488",
                VehicleType = VehicleType.MotorBoat,
                Id = rnd.Next().ToString()
            };

            await OwinTester.Run(new Post<Client, Client>
            {
                Uri = () => "client",
                Content = () => client,
                ExpectedStatusCode = HttpStatusCode.Created,
                AssertResponseContent = (response, content) =>
                {
                    Assert.Equal($"http://localhost/client/{content.Id}", response.Headers.Location.ToString());
                }

            });
        }

        //[Fact]
        public async Task CanGetClient()
        {
            var client = new Client
            {
                BoatModel = "ho7",
                Email = "i@h.com",
                EngineType = "hoho hoho",
                HullSize = HullSizeType.Large,
                LastName = "glinsek",
                Name = "nacho",
                PhoneNumber = "123488",
                VehicleType = VehicleType.MotorBoat,
                Id = rnd.Next().ToString()
            };

            await OwinTester.Run(new Post<Client>()
            {
                Uri = () => "client",
                Content = () => client,
                ExpectedStatusCode = HttpStatusCode.Created,

            }, new Get<Client>()
            {
                Uri = () => $"client/{client.Id}",
                ExpectedStatusCode = HttpStatusCode.OK,
                AssertResponseContent = (response, content) =>
                {
                    Assert.NotNull(content);
                    Assert.Equal(client.Id, content.Id);
                }
            });
        }

        //[Fact]
        public async Task CanUpdateProfilePic()
        {
            var avatar = new AvatarViewModel
            {
                ImageBase64 = @"data:image/png;base64,"
            };
            var client = new Client
            {
                BoatModel = "ho7",
                Email = "i@h.com",
                EngineType = "hoho hoho",
                HullSize = HullSizeType.Large,
                LastName = "glinsek",
                Name = "nacho",
                PhoneNumber = "123488",
                VehicleType = VehicleType.MotorBoat,
                Id = rnd.Next().ToString()
            };

            await OwinTester.Run(new Post<Client>()
            {
                Uri = () => "client",
                Content = () => client,
                ExpectedStatusCode = HttpStatusCode.Created,

            }, new Post<AvatarViewModel, string>()
            {
                Uri = () => $"client/profilepic/{client.Id}",
                Content = () => avatar,
                ExpectedStatusCode = HttpStatusCode.OK,
                AssertResponseContent = (response, content) =>
                {
                    Assert.NotNull(content);
                }
            });
        }
    }
}
